B.yA=new A.i9("2","Coffees","https://images.pexels.com/photos/302899/pexels-photo-302899.jpeg?auto=compress&cs=tinysrgb&w=840&h=500&dpr=1",B.DZ)
B.yi=new A.bp("1","French Press","This manual coffee maker is extremely easy to use. Add ground coffee beans into your French press, pour piping hot water over the grounds, let the coffee steep for a few minutes and finally, press the plunger down and pour! Simple as that. French presses can be used for any bean, but many people prefer using them for darker, richer roasts. Also, how fancy does this French press look? Make your morning brew\u2026in style!\n\nFor a perfect cup of coffee, use a French press. But this cylindrical carafe, plunger and filter can do more than brew a beautiful light roast. We found plenty of French press hacks!\n","https://images.pexels.com/photos/1649282/pexels-photo-1649282.jpeg?auto=compress&cs=tinysrgb&w=840&h=500&dpr=1")
B.yt=new A.bp("2","Percolator","Try out a percolator to add a retro feel to your daily brew\u2014like 1880s retro. To put it simply, percolators brew coffee by continuously pushing boiling hot water bubbles up into the \u201ccoffee chamber\u201d to steep the coffee grains. This cycle is repeated until the coffee is ready to serve. They\u2019re typically used for medium roasts and prepared over the stovetop, but percolators can work over any heated surface, even a campfire (hint, hint!).","https://images.pexels.com/photos/221445/pexels-photo-221445.jpeg?auto=compress&cs=tinysrgb&w=840&h=500&dpr=1")
B.y5=new A.bp("3","Single Serve","Single serve coffee maker sales have really peaked in the past few years. Measure out your desired coffee amount, pour into the reusable filter, pour water in and voila! A cup of coffee just for you will be ready soon. Single serve coffee makers are perfect for single-person households (or those where just one person drinks coffee). Try out this budget-friendly single serve coffee maker which includes a fun travel mug!","https://images.pexels.com/photos/5045608/pexels-photo-5045608.jpeg?auto=compress&cs=tinysrgb&w=840&h=500&dpr=1")
B.yg=new A.bp("4","AeroPress","We\u2019ve got another manual coffee maker for you. The AeroPress is very similar to the French press. To use an AeroPress, we recommend checking out this beautiful get-started guide. You can make espresso, lattes, cold brews or just a classic cup of coffee in this nifty little machine.","https://images.pexels.com/photos/5461656/pexels-photo-5461656.jpeg?auto=compress&cs=tinysrgb&w=840&h=500&dpr=1")
B.ym=new A.bp("5","Drip","Aah, yes. The classic electric coffee maker you know and love. To get your brew going in a drip coffee maker, all you have to do is scoop your coffee, pour it into the filter, pour some water in and press start to let the drip coffee maker do it\u2019s coffee magic. Soon, you\u2019ll hear the sweet sounds of your coffee dripping right into your coffee pot. Mornings, conquered.\n\nSome drip coffee makers also come with a thermal carafe. Typically with a double layered, stainless steel wall, thermal carafes keep your coffee tasting fresh and hot for hours longer than most glass carafes do. Some drip coffee makers use a thermal carafe, but traditionally, they use a glass carafe instead.\n","https://images.pexels.com/photos/6660455/pexels-photo-6660455.jpeg?auto=compress&cs=tinysrgb&w=840&h=500&dpr=1")
B.yx=new A.bp("6","Pour Over","A pour-over coffee maker is exactly what it sounds like: you manually pour hot water over the beans. With a solid 5-star rating on Amazon, pour-over coffee makers like Chemex are a solid choice. Fans love the fact that you get to control the strength of the coffee, plus the pots are super easy to clean. You do need a special kind of filter, though, which is pricier than the typical drip coffee filter. However, some are reusable.","https://images.pexels.com/photos/5328288/pexels-photo-5328288.jpeg?auto=compress&cs=tinysrgb&w=840&h=500&dpr=1")
B.yu=new A.bp("7","Cold Brew","Diehard cold brew fans may want to invest in a cold brew coffee maker. To use a cold brew maker, throw in your coffee grounds, brew and serve. You can store the coffee for up to 36 hours. If you\u2019re looking for a multi-functional coffee maker, you can prepare cold brew coffees in other makers, like the AeroPress.","https://images.pexels.com/photos/4552181/pexels-photo-4552181.jpeg?auto=compress&cs=tinysrgb&w=840&h=500&dpr=1")
B.yr=new A.bp("8","Moka","Moka pots share a lot of similarities with the percolator and there\u2019s often confusion between the two. Both need a heated surface, like a stovetop or even a campfire. However, the Moka pot produces an espresso-like drink and its brewing process is a bit different than the percolator. You need to keep more of an eye on it because when the Moka pot\u2019s water is spent, you should remove the pot from the heat surface to avoid burnt-tasting coffee. Whereas with the percolator\u2019s simple brewing process, the longer you leave it running, the stronger the coffee will be.","https://images.pexels.com/photos/4424672/pexels-photo-4424672.jpeg?auto=compress&cs=tinysrgb&w=840&h=500&dpr=1")
